import React from 'react'
import { useSelector } from 'react-redux'
import styled from 'styled-components'
import Card from '../card'
export default function Home() {
    const store = useSelector((store: any) => store.array)
    const state = store
    return (
        <Container>
            <Cart />
            {
                state.map((a: any) => (
                    <Card key={a.id} id={a.id} name={a.name} price={a.price} description={a.description} image={a.image} count={a.count} />
                ))
            }
        </Container>
    )
}

const Container = styled.div`
    display: flex;
    flex-wrap: wrap;
    justify-content: left;
    align-items: center;
    width: 100%;
    max-width: 1324px;
    padding: 40px 0;
    margin: auto;
`
